import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import SignUp from './pages/SignUp';
import DoctorDashboard from './pages/doctor/DoctorDashboard';
import PatientDashboard from './pages/patient/PatientDashboard';
import PatientFile from './pages/doctor/PatientFile';
import PatientList from './pages/doctor/PatientList';
import AddPatient from './pages/doctor/AddPatient';
import Recommendations from './pages/doctor/Recommendations';
import PatientView from './pages/patient/PatientView';
import PatientHistory from './pages/patient/PatientHistory';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Navigate to="/login" />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<SignUp />} />
          
          {/* Doctor Routes */}
          <Route path="/doctor" element={<DoctorDashboard />} />
          <Route path="/doctor/patients" element={<PatientList />} />
          <Route path="/doctor/patient/add" element={<AddPatient />} />
          <Route path="/doctor/patient/:id" element={<PatientFile />} />
          <Route path="/doctor/recommendations/:id" element={<Recommendations />} />
          
          {/* Patient Routes */}
          <Route path="/patient" element={<PatientDashboard />} />
          <Route path="/patient/profile" element={<PatientView />} />
          <Route path="/patient/history" element={<PatientHistory />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
